import React from 'react';
import './About.css';
import exampleImage from '../assets/squid-image.png'; // Replace with your actual image path

function About() {
  return (
    <section className="about-section">
      <div className="about-content">
        <div className="about-text">
          <p>
          yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap yap 
          </p>
          <a href="/about-us" className="about-button">Learn More</a> {/* Button linking to About Us page */}
        </div>
        <div className="about-image">
          <img src={exampleImage} alt="Psychology Community" />
        </div>
      </div>
    </section>
  );
}

export default About;
